#include <stdio.h>

int getmin(int *g,int start,int size)
{
	int min = 0;
	int seq = 0;
	for (int i = start;i < size-1;i++)
	{
		min = g[i];
		seq = i;
		if(min > g[i+1])
		{
			min = g[i+1];
			seq = i+1;
		}
	}
	
	return seq;
}

int select_sort(int *g,int size)
{
	int tmp = 0;
	int seq = -1;
	
	for (int i = 0; i < size; i++)
	{
		seq = getmin(g,i,size);
		printf("%d\n\n",seq);
		
		if (i != seq)
		{
			tmp = g[i];
			g[i] = g[seq];
			g[seq] = tmp;
		}
	}
}

